import React from 'react'
import classes from './GlobalSheet.module.scss'

const Global = ({data}) => {
    let pasreData = null;
    let theData = data;
    data().then((item) => {
      pasreData = item;
     console.log(pasreData);
    });
    console.log(theData);
    console.log(pasreData);
    return (
        <div className={classes.sheet__wrapper}>
            <table>
                <thead>
                    <td>Global cases!</td>
                </thead>
                <tbody>
                    <td>{pasreData}</td>
                </tbody>
            </table>
        </div>
    );
};
  
export default Global;
